function ss(arrayN, s, d) {
    let res;
    if (s == "") {
        s = arrayN[0];
    } else {
        s = s;
    }
    if (d == "") {
        d = arrayN[arrayN.length - 1];
    } else {
        d = d;
    }
    res = arrayN.slice(arrayN.indexOf(s), arrayN.indexOf(d) + 1);
    return res;
}

